import React from "react";
import styled from "styled-components";

const TwojaStara = styled.div`
  background-color: #004aad;
  width: 100%;
  height: 100%;
`;

const Cards = styled.div`
  width: 15%;
  padding: 2rem;
`;

const Card = styled.div`
  color: white;
  text-align: center;
  padding: 2rem;
  border: white 10px 16px;
`;

const Desinger = () => {
  return (
    <TwojaStara>
      <Cards>
        <Card>Text</Card>
        <Card>Text</Card>
        <Card>Text</Card>
        <Card>Text</Card>
        <Card>Text</Card>
      </Cards>
    </TwojaStara>
  );
};

export default Desinger;
